(2, 0, 'songhb', '“员工管理” 增加筛选条件', '能不能把员工分成不同的部门，随着用的人越来越多，现在的列表很难找人。。。\n\n能不能像之前的开通帐号一样，一个部门一个版块，这样方便部门的管理！。。\n\n海波6.15', NULL, '2011-06-15 11:45:16', '2011-06-15 11:45:16'),
